def Plot3DTriSurf(points):
    fig = plt.figure()
    ax = fig.gca(projection='3d')
    x = []
    y = []
    z = []
    
    for coord in points:
        x.append(coord[0])
        y.append(coord[1])
        z.append(coord[2] * 3)
        
        
    ax.plot_trisurf(x, y, z, linewidth=0.2)
    plt.show()
    
